      description:
        "\u0421\u0442\u0430\u0434\u0438\u043e\u043d \u00ab\u0410\u043d\u0436\u0438-\u0430\u0440\u0435\u043d\u0430\u00bb \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 22 \u0438\u044e\u043b\u044f 2003 \u0433\u043e\u0434\u0430. \u0412 \u0434\u0435\u043d\u044c \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u043d\u0430 \u0430\u0440\u0435\u043d\u0435 \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430 \u0424\u041d\u041b \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u0430\u0442\u0447 \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u043b\u0443\u0431\u0430 \u00ab\u0410\u043d\u0436\u0438\u00bb \u0441 \u043a\u0440\u0430\u0441\u043d\u043e\u0434\u0430\u0440\u0441\u043a\u043e\u0439 \u00ab\u041a\u0443\u0431\u0430\u043d\u044c\u044e\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043d\u0430\u0448\u0430 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0430 \u043f\u043e\u0431\u0435\u0434\u0443 \u0441\u043e \u0441\u0447\u0435\u0442\u043e\u043c 1:0.\n\u041d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0430 \u0435\u0441\u0442\u044c \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u0439 - \u044d\u0442\u043e \u043a\u043b\u0443\u0431 \u043b\u0430\u0437\u0435\u0440\u0442\u0430\u0433\u0430 \u00abLasertag Arena\u00bb, \u0431\u0430\u0442\u0443\u0442\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440 \u00ab\u0410\u0440\u0435\u043d\u0430\u00bb, \u0430\u0442\u0442\u0440\u0430\u043a\u0446\u0438\u043e\u043d\u044b \u0438 \u043a\u0430\u0444\u0435. \u0412 2013 \u0433\u043e\u0434\u0443 \u0441\u0442\u0430\u0434\u0438\u043e\u043d \u0431\u044b\u043b \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0440\u0435\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u0438\u0440\u043e\u0432\u0430\u043d \u0438 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d \u0432 \u00ab\u0410\u043d\u0436\u0438- \u0430\u0440\u0435\u043d\u0430\u00bb, \u0438 \u043f\u043e \u043f\u0440\u0430\u0432\u0443 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0434\u043e\u0441\u0442\u043e\u043f\u0440\u0438\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438.",
