        "\u0412 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0434\u043b\u044f \u0442\u0443\u0440\u0438\u0441\u0442\u043e\u0432, \u043f\u043e\u0441\u0435\u0449\u0430\u044e\u0449\u0438\u0445 \u042e\u0436\u043d\u044b\u0439 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d, \u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438 \u0422\u0430\u0431\u0430\u0441\u0430\u0440\u0430\u043d\u0441\u043a\u0438\u0439 \u0438 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d\u044b, \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u044b \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u044d\u043a\u0441\u043a\u0443\u0440\u0441\u0438\u043e\u043d\u043d\u044b\u0435 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u0441 \u043c\u0430\u0441\u0442\u0435\u0440-\u043a\u043b\u0430\u0441\u0441\u0430\u043c\u0438 \u043d\u0430 \u0442\u043a\u0430\u0446\u043a\u0438\u0445 \u0441\u0442\u0430\u043d\u0430\u0445. \u0410 \u0432 \u0441. \u0425\u0438\u0432 \u0442\u0443\u0440\u0438\u0441\u0442\u044b \u043c\u043e\u0433\u0443\u0442 \u043f\u043e\u0441\u0435\u0442\u0438\u0442\u044c \u0425\u0438\u0432\u0441\u043a\u0443\u044e \u043a\u043e\u0432\u0440\u043e\u0432\u0443\u044e \u0444\u0430\u0431\u0440\u0438\u043a\u0443. \u0421\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0441\u0430\u043c\u043e\u0431\u044b\u0442\u043d\u044b\u0435 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u0438 \u043f\u0440\u043e\u043c\u044b\u0441\u043b\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u0438\u0441\u044c \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0436\u0435\u043d\u0449\u0438\u043d\u044b, \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u043b\u0438\u0441\u044c \u043d\u0430 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u0438\u0438\n\u0432\u0435\u043a\u043e\u0432 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0443 \u0432\u0441\u0435\u0445 \u0433\u043e\u0440\u043d\u044b\u0445 \u043d\u0430\u0440\u043e\u0434\u043e\u0432. \u0412 XIX \u0432., \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0434\u0430\u043d\u043d\u044b\u043c, \u0432 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0435 \u043d\u0430\u0441\u0447\u0438\u0442\u044b\u0432\u0430\u043b\u043e\u0441\u044c \u0441\u0432\u044b\u0448\u0435 40 \u0442\u044b\u0441. \u043a\u043e\u0432\u0440\u043e\u0442\u043a\u0430\u0447\u0438\u0445, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u044f\u043b\u0438 \u0432\u0441\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u044b\u0435 \u0432\u0438\u0434\u044b \u043a\u043e\u0432\u0440\u043e\u0432: \u0432\u043e\u0440\u0441\u043e\u0432\u044b\u0435, \u0431\u0435\u0437\u0432\u043e\u0440\u0441\u043e\u0432\u044b\u0435, \u0432\u043e\u0439\u043b\u043e\u0447\u043d\u044b\u0435.",
