      description:
        "\u041a\u044b\u0440\u0445\u043b\u044f\u0440 - \u044d\u0442\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0437\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u0438\u0435 VII - IX \u0432\u0432. \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043e \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u043a\u043b\u0430\u0434\u0431\u0438\u0449\u0430 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0430. \u0421\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u041a\u044b\u0440\u0445\u043b\u044f\u0440 \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0440\u0430\u043d\u043d\u0438\u0445 \u0430\u0440\u0430\u0431\u0441\u043a\u0438\u0445 \u043f\u043e\u0445\u043e\u0434\u043e\u0432 \u043d\u0430 \u0414\u0435\u0440\u0431\u0435\u043d\u0442, \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0432 643 \u0433. \u0421\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043b\u0435\u0433\u0435\u043d\u0434\u0435, \u0433\u0430\u0437\u0438\u0438 (\u0433\u0435\u0440\u043e\u0438 \u0431\u043e\u0440\u044c\u0431\u044b \u0437\u0430 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0441\u043a\u0443\u044e \u0432\u0435\u0440\u0443) \u0441\u0440\u0430\u0436\u0430\u043b\u0438\u0441\u044c \u0441 \u0445\u0430\u0437\u0430\u0440\u0430\u043c\u0438 \u0432 \u0445\u043e\u0434\u0435 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0433\u043e \u0434\u0436\u0438\u0445\u0430\u0434\u0430 - \u0442\u043e \u0435\u0441\u0442\u044c \u0447\u0442\u043e\u0431\u044b \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u044c \u043c\u0435\u0441\u0442\u043d\u044b\u0445 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0432 \u043f\u0440\u0430\u0432\u043e\u0432\u0435\u0440\u043d\u044b\u0439 \u0438\u0441\u043b\u0430\u043c. \u0413\u043b\u0430\u0432\u043d\u0430\u044f \u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0430\u0441\u044c \u0448\u0435\u0441\u0442\u044c \u0434\u043d\u0435\u0439, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0431\u044b\u043b\u0438 \u0443\u0431\u0438\u0442\u044b 20 \u0442\u044b\u0441. \u043d\u0435\u0432\u0435\u0440\u043d\u044b\u0445. \u0421\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0436\u0435 \u0430\u0440\u0430\u0431\u043e\u0432 \u043f\u043e\u0442\u0435\u0440\u0438 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0438 \u0432\u0441\u0435\u0433\u043e \u043b\u0438\u0448\u044c 40 \u0432\u043e\u0438\u043d\u043e\u0432, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u0442\u0430\u043b\u0438 \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0448\u0430\u0445\u0438\u0434\u0430\u043c\u0438 \u0438 \u0431\u044b\u043b\u0438 \u043f\u043e\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u044b \u0438\u043c\u0435\u043d\u043d\u043e \u043d\u0430 \u043a\u043b\u0430\u0434\u0431\u0438\u0449\u0435 \u041a\u044b\u0440\u0445\u043b\u044f\u0440. \u0417\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u0438\u0435, \u0432\u043d\u0435\u0441\u0451\u043d\u043d\u043e\u0435 \u0432 \u0441\u043f\u0438\u0441\u043e\u043a \u043e\u0445\u0440\u0430\u043d\u044f\u0435\u043c\u044b\u0445 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u043e\u0432, \u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u043a\u0430\u043a \u0433\u043b\u0430\u0432\u043d\u0435\u0439\u0448\u0430\u044f \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0441\u0432\u044f\u0442\u044b\u043d\u044f \u0432\u0435\u0440\u0443\u044e\u0449\u0438\u043c\u0438 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0430, \u043d\u043e \u0438 \u0432\u0441\u0435\u0433\u043e \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430. \u0421\u044e\u0434\u0430 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043f\u0440\u0438\u0435\u0437\u0436\u0430\u044e\u0442 \u0434\u043b\u044f \u043c\u043e\u043b\u0438\u0442\u0432\u044b. \u041f\u043e\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0435 \u041a\u044b\u0440\u0445\u043b\u044f\u0440\u0430 \u0432\u044b\u0441\u0442\u0440\u043e\u0435\u043d\u043e \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0435 \u0437\u0434\u0430\u043d\u0438\u0435 \u0438\u0437 \u043a\u0430\u043c\u043d\u044f, \u043d\u0430\u043a\u0440\u044b\u0442\u043e\u0435 \u043a\u0443\u043f\u043e\u043b\u043e\u043c \u0432\u044b\u0441\u043e\u0442\u043e\u0439 \u0432 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u0439 \u0440\u043e\u0441\u0442. \u0412 \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0435 \u0435\u0441\u0442\u044c \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u0430\u044f \u0432\u044b\u0435\u043c\u043a\u0430 \u0434\u043b\u044f \u043f\u043e\u0434\u043d\u043e\u0448\u0435\u043d\u0438\u0439, \u043a\u0443\u0434\u0430 \u043c\u043e\u0436\u043d\u043e \u043a\u043b\u0430\u0441\u0442\u044c \u043c\u043e\u043d\u0435\u0442\u044b \u0438 \u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0441\u0432\u0435\u0447\u0438.",
