      description:
        "\u0421 1967 \u0433\u043e\u0434\u0430 \u0432 \u0434\u043e\u043c\u0435 \u0413\u0430\u043c\u0437\u0430\u0442\u0430 \u0426\u0430\u0434\u0430\u0441\u044b \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u043c\u0443\u0437\u0435\u0439. \u041f\u0435\u0440\u0432\u044b\u0439 \u044d\u0442\u0430\u0436 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d \u0432 \u0432\u0438\u0434\u0435 \u0433\u043e\u0440\u0441\u043a\u043e\u0439 \u0441\u0430\u043a\u043b\u0438. \u0417\u0434\u0435\u0441\u044c \u043c\u043e\u0436\u043d\u043e \u0443\u0432\u0438\u0434\u0435\u0442\u044c, \u043a\u0430\u043a \u0436\u0438\u043b\u0438 \u0433\u043e\u0440\u0446\u044b \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 50 - 60 \u043b\u0435\u0442 \u043d\u0430\u0437\u0430\u0434: \u0433\u043b\u0438\u043d\u043e\u0431\u0438\u0442\u043d\u044b\u0435 \u043f\u043e\u043b\u044b, \u043e\u0431\u043c\u0430\u0437\u0430\u043d\u043d\u044b\u0435 \u0441\u0438\u043d\u0435\u0439 \u0433\u043b\u0438\u043d\u043e\u0439, \u0433\u043b\u0438\u043d\u043e\u0431\u0438\u0442\u043d\u044b\u0439 \u043e\u0447\u0430\u0433, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u043b\u0441\u044f \u0432 \u043a\u0430\u0436\u0434\u043e\u043c \u0434\u043e\u043c\u0435. \u0421\u0440\u0435\u0434\u0438 \u044d\u043a\u0441\u043f\u043e\u043d\u0430\u0442\u043e\u0432 \u0440\u0430\u0437\u043d\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u0430\u044f \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0443\u0442\u0432\u0430\u0440\u044c: \u0430\u0440\u0431\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0437\u0430\u043f\u0440\u044f\u0433\u0430\u043b\u0438 \u043f\u0430\u0440\u0443 \u0432\u043e\u043b\u043e\u0432, \u0434\u043e\u0441\u043a\u0438-\u043c\u043e\u043b\u043e\u0442\u0438\u043b\u043a\u0438, \u0434\u0440\u0443\u0433\u0438\u0435 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u044b \u0431\u044b\u0442\u0430. \u041d\u0430 \u0437\u0430\u0441\u0442\u0435\u043a\u043b\u0435\u043d\u043d\u043e\u0439 \u0432\u0435\u0440\u0430\u043d\u0434\u0435 \u0432\u0442\u043e\u0440\u043e\u0433\u043e \u044d\u0442\u0430\u0436\u0430 \u0434\u043e\u043c\u0430 \u0440\u0430\u0437\u043c\u0435\u0449\u0435\u043d\u0430 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u044f, \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0430\u044f \u0436\u0438\u0437\u043d\u0438 \u0438 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0443 \u043f\u043e\u044d\u0442\u0430, \u0435\u0433\u043e \u0441\u0435\u043c\u044c\u0435. \u041f\u043e\u0441\u0435\u0442\u0438\u0442\u0435\u043b\u0438 \u0443\u0432\u0438\u0434\u044f\u0442 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438 \u0438\u0437 \u0441\u0435\u043c\u0435\u0439\u043d\u043e\u0433\u043e \u0430\u0440\u0445\u0438\u0432\u0430, \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b, \u043a\u043d\u0438\u0433\u0438, \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u043b\u0438\u0447\u043d\u044b\u0435 \u0432\u0435\u0449\u0438 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u043e\u0440\u0430. \u0417\u0434\u0435\u0441\u044c \u043c\u043e\u0436\u043d\u043e \u0443\u0437\u043d\u0430\u0442\u044c \u043e \u0436\u0438\u0437\u043d\u0438 \u043f\u043e\u044d\u0442\u0430 \u0438 \u0435\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0435.",
