      description:
        "\u0421\u043e\u0441\u0442\u043e\u0438\u0442 \u043d\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043e\u0445\u0440\u0430\u043d\u0435 \u043a\u0430\u043a \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b XIII \u0432., \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u043c \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f, \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420 \u21161327 \u043e\u0442 30.08.1960\u0433.\n\n\u0414\u0440\u0435\u0432\u043d\u0438\u0435 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0431\u0430\u043d\u0438 \u2014 \u044d\u0442\u043e \u0437\u0430\u0433\u043b\u0443\u0431\u043b\u0435\u043d\u043d\u044b\u0435 \u0432 \u0437\u0435\u043c\u043b\u044e \u043d\u0430 2-3 \u043c\u0435\u0442\u0440\u0430 \u0441\u0432\u043e\u0434\u0447\u0430\u0442\u043e\u2013\u043a\u0443\u043f\u043e\u043b\u044c\u043d\u044b\u0435 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u044f, \u043e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u044b\u0435 \u0432\u0435\u0440\u0445\u043d\u0438\u043c \u0441\u0432\u0435\u0442\u043e\u043c, \u043f\u0440\u043e\u043d\u0438\u043a\u0430\u044e\u0449\u0438\u043c \u0447\u0435\u0440\u0435\u0437 \u043e\u0442\u0432\u0435\u0440\u0441\u0442\u0438\u044f \u0432 \u043a\u0443\u043f\u043e\u043b\u0430\u0445 \u0438 \u0441\u0432\u043e\u0434\u0430\u0445, \u0438\u043c\u0435\u044e\u0449\u0438\u0435 \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0438 \u0432\u0435\u0441\u044c\u043c\u0430 \u0441\u043b\u043e\u0436\u043d\u0443\u044e \u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043a\u0443.\n\n\u0414\u0435\u0432\u0438\u0447\u044c\u044f \u0431\u0430\u043d\u044f \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0430 \u043d\u0430 7 \u043c\u0430\u0433\u0430\u043b\u0435 \u0441\u0442\u0430\u0440\u0438\u043d, \u0432 50 \u043c\u0435\u0442\u0440\u0430\u0445 \u043e\u0442 \u041e\u0440\u0442\u0430-\u043a\u0430\u043f\u044b \u0438 \u0432 50 \u043c\u0435\u0442\u0440\u0430\u0445 \u043e\u0442 \u0414\u0436\u0443\u043c\u0430-\u043c\u0435\u0447\u0435\u0442\u0438. \u0421 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u043a \u043d\u0435\u0439 \u043f\u0440\u0438\u043c\u044b\u043a\u0430\u0435\u0442 \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u0430\u044f \u0416\u0435\u043d\u0441\u043a\u0430\u044f \u0431\u0430\u043d\u044f-XVII \u0432. \u0421 \u044e\u0436\u043d\u043e\u0439 \u0438 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d \u2014 \u0436\u0438\u043b\u044b\u0435 \u0437\u0434\u0430\u043d\u0438\u044f, \u0441 \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u2014 \u0443\u043b\u0438\u0446\u0430, \u0432\u0435\u0434\u0443\u0449\u0430\u044f \u043e\u0442 \u041e\u0440\u0442\u0430-\u043a\u0430\u043f\u044b \u043a \u0414\u0436\u0443\u043c\u0430-\u043c\u0435\u0447\u0435\u0442\u0438.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0434\u0435\u0432\u0438\u0447\u044c\u0438\u0445 \u0431\u0430\u043d\u044c \u2014 135 \u043a\u043c.",
