        "\u0426\u0435\u043d\u0442\u0440 \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0432 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u0435 - \u0443\u043d\u0438\u043a\u0430\u043b\u044c\u043d\u043e\u0435 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u043c\u0435\u0441\u0442\u043e, \u0433\u0434\u0435 \u043c\u043e\u0436\u043d\u043e \u043d\u0430\u043f\u043e\u043b\u043d\u0438\u0442\u044c \u0441\u0435\u0431\u044f \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0437\u043d\u0430\u043d\u0438\u044f\u043c\u0438 \u0431\u044b\u0442\u0430 \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0441\u0432\u043e\u0435\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430, \u043f\u0440\u043e\u043d\u0438\u043a\u043d\u0443\u0442\u044c\u0441\u044f \u0434\u0443\u0445\u043e\u043c \u0438 \u0430\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u043e\u0439 \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e, \u043d\u043e \u0438 \u043f\u0440\u0438\u043a\u043e\u0441\u043d\u0443\u0442\u044c\u0441\u044f \u043a \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0443. \u0411\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u0432 2012 \u0433\u043e\u0434\u0443. \u0424\u0430\u0441\u0430\u0434 \u0437\u0434\u0430\u043d\u0438\u044f \u043f\u043e\u0445\u043e\u0436 \u043d\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0434\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0432\u0435\u0440. \u0415\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u044c - \u043e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0441\u0442\u0430\u0440\u0438\u043d\u043d\u044b\u0445 \u0432\u0435\u0449\u0435\u0439, \u0432\u0435\u0434\u044c \u0432\u0441\u0435 \u043d\u043e\u0432\u043e\u0435 - \u044d\u0442\u043e \u0445\u043e\u0440\u043e\u0448\u043e \u0437\u0430\u0431\u044b\u0442\u043e\u0435 \u0441\u0442\u0430\u0440\u043e\u0435. \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u0426\u0435\u043d\u0442\u0440\u0443 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u0438\u0437\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430. \u0417\u0434\u0435\u0441\u044c \u043f\u0440\u043e\u0445\u043e\u0434\u044f\u0442 \u0447\u0442\u0435\u043d\u0438\u044f \u0438 \u043f\u043e\u043a\u0430\u0437\u044b, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0442\u0435\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043a\u0440\u0443\u0433\u043b\u044b\u0435 \u0441\u0442\u043e\u043b\u044b. \u0426\u0435\u043d\u0442\u0440 \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0432 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u0435 \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0434\u0438\u043d\u0430\u043c\u0438\u0447\u043d\u044b\u0445 \u0430\u0440\u0442 \u043f\u043b\u043e\u0449\u0430\u0434\u043e\u043a \u0433\u043e\u0440\u043e\u0434\u0430",
