      description:
        "\u041c\u0443\u0437\u0435\u0439 \u043a\u043e\u0432\u0440\u0430 \u0438 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u043e-\u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u0433\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0443\u043d\u0438\u043a\u0430\u043b\u044c\u043d\u043e\u043c \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u043c \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0435 XIX \u0432. \u0410\u0440\u043c\u044f\u043d\u043e-\u0433\u0440\u0438\u0433\u043e\u0440\u0438\u0430\u043d\u0441\u043a\u043e\u043c \u0445\u0440\u0430\u043c\u0435, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u0432 1860 \u0433. \u043f\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u0443 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f \u0413. \u0421\u0443\u043d\u0434\u0443\u043a\u044f\u043d\u0430. \u0412 \u043f\u044f\u0442\u0438 \u0440\u0430\u0437\u0434\u0435\u043b\u0430\u0445 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u044d\u043a\u0441\u043f\u043e\u043d\u0430\u0442\u044b, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0443\u044e\u0449\u0438\u0435 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0432\u0438\u0434\u044b \u0440\u0435\u043c\u0451\u0441\u0435\u043b \u0438 \u043f\u0440\u043e\u043c\u044b\u0441\u043b\u043e\u0432 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0430 \u0438 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 XIX-\u0425\u0425 \u0432\u0432.: \u043a\u0435\u0440\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e, \u043c\u0435\u0434\u043d\u043e-\u0447\u0435\u043a\u0430\u043d\u043d\u0430\u044f \u0443\u0442\u0432\u0430\u0440\u044c, \u043a\u043e\u0432\u0440\u043e\u0432\u043e\u0435 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u043e \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 XIX-XX \u0432\u0432., \u0440\u0435\u0437\u044c\u0431\u0430 \u043f\u043e \u0434\u0435\u0440\u0435\u0432\u0443, \u0441\u0435\u0440\u0435\u0431\u0440\u044f\u043d\u044b\u0435 \u0438\u0437\u0434\u0435\u043b\u0438\u044f \u0434\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0445 \u043c\u0430\u0441\u0442\u0435\u0440\u043e\u0432.",
