      description:
        "\u042d\u0442\u043d\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u00ab\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u0430\u0443\u043b\u00bb - \u043c\u043d\u043e\u0433\u043e\u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043c\u0443\u0437\u0435\u0439\u043d\u044b\u0439, \u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439, \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e-\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440, \u0446\u0435\u043b\u044c\u044e \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u0435 \u0441\u043e\u0445\u0440\u0430\u043d\u043d\u043e\u0441\u0442\u0438, \u043f\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435, \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0435 \u0438 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u0438\u0437\u0430\u0446\u0438\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u043e-\u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f \u043a\u0440\u0430\u044f \u0434\u043b\u044f \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0438 \u0433\u043e\u0441\u0442\u0435\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u042d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u043a\u0430\u0436\u0434\u043e\u0433\u043e \u0434\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430 \u0432\u043a\u043b\u044e\u0447\u0430\u0435\u0442 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u0430 \u0436\u0438\u043b\u0438\u0449\u0430, \u043c\u0435\u0434\u043d\u0443\u044e, \u043a\u0435\u0440\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0438 \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u0443\u044e \u0443\u0442\u0432\u0430\u0440\u044c, \u043e\u0440\u0443\u0434\u0438\u044f \u0442\u0440\u0443\u0434\u0430, \u043e\u0440\u0443\u0436\u0438\u0435,\u00a0\u00a0\u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u043e\u0434\u0435\u0436\u0434\u0443 \u0438 \u044e\u0432\u0435\u043b\u0438\u0440\u043d\u044b\u0435 \u0443\u043a\u0440\u0430\u0448\u0435\u043d\u0438\u044f,\u00a0\u00a0\u043a\u043e\u0432\u0440\u044b \u0438 \u043a\u043e\u0432\u0440\u043e\u0432\u044b\u0435 \u0438\u0437\u0434\u0435\u043b\u0438\u044f,\u00a0\u00a0\u0432\u044b\u0448\u0438\u0432\u043a\u0443 \u0448\u0435\u043b\u043a\u043e\u043c \u0438 \u0437\u043e\u043b\u043e\u0442\u043e\u043c, \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u044b\u0435 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b, \u0441\u0442\u0430\u0440\u0438\u043d\u043d\u044b\u0435 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438 \u0438 \u0442. \u0434.",
