      description:
        "\u0410\u0432\u0430\u0440\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e-\u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0431\u044b\u043b \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0432 1935 \u0433. \u0432 \u0441. \u0425\u0443\u043d\u0437\u0430\u0445, \u0425\u0443\u043d\u0437\u0430\u0445\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0430, \u043d\u043e \u0441\u0432\u043e\u0435\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u043c \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u043a\u0438\u043c \u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442\u043e\u043c \u0432 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u0430\u0442\u0440\u0430 \u043c\u043e\u0436\u043d\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c \u043a\u0440\u0443\u0436\u043e\u043a \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u0430\u043c\u043e\u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432 \u043f\u043e\u0441\u043b\u0435\u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u0433\u043e\u0434\u044b \u043d\u0430\u0447\u0430\u043b \u0441\u0432\u043e\u044e \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438 \u0425\u0443\u043d\u0437\u0430\u0445\u0441\u043a\u043e\u043c \u0432\u043e\u0435\u043d\u043d\u043e\u043c \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0435. \u041e\u0431\u043b\u0438\u043a \u0442\u0435\u0430\u0442\u0440\u0430 \u043e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u0435\u043d, \u043d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0443\u044e \u043e\u0441\u043d\u043e\u0432\u0443. \u0413\u043b\u0430\u0432\u043d\u0430\u044f \u0442\u0435\u043c\u0430 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u0438 - \u043f\u0440\u043e\u0441\u0442\u043e\u0439 \u0438 \u0432\u0435\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0438\u043f\u0442\u0435\u0440, \u043f\u0435\u0440\u0435\u0432\u043e\u043f\u043b\u043e\u0449\u0435\u043d\u043d\u044b\u0439 \u0432 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u0444\u043e\u0440\u043c\u044b. \u0415\u0433\u043e \u043a\u043e\u043d\u0443\u0441\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u0435 \u043e\u043f\u043e\u0440\u044b \u0430\u0441\u0441\u043e\u0446\u0438\u0438\u0440\u0443\u044e\u0442\u0441\u044f \u0441 \u0434\u0440\u0435\u0432\u043d\u0438\u043c\u0438 \u043a\u0430\u0432\u043a\u0430\u0437\u0441\u043a\u0438\u043c\u0438 \u0431\u0430\u0448\u043d\u044f\u043c\u0438. \u041a\u0440\u043e\u0432\u043b\u044f, \u0431\u0430\u043b\u043a\u043e\u043d\u044b, \u043e\u043f\u043e\u0440\u044b, \u043b\u0435\u0441\u0442\u043d\u0438\u0446\u044b \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0441\u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u044b; \u043a\u043e\u043d\u0442\u0440\u0430\u0441\u0442 \u0432\u043e\u0437\u043d\u043e\u0441\u044f\u0449\u0438\u0445\u0441\u044f \u0432\u0432\u0435\u0440\u0445 \u043c\u043e\u0433\u0443\u0447\u0438\u0445 \u0441\u0442\u043e\u043b\u0431\u043e\u0432 \u0438 \u043b\u0435\u0433\u043a\u043e\u0439 \u043a\u0440\u044b\u0448\u0438 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u043e\u0441\u043d\u043e\u0432\u0443 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u0430.",
