      description:
        "\u041f\u0440\u043e\u0441\u043f\u0435\u043a\u0442 \u0420\u0430\u0441\u0443\u043b\u0430 \u0413\u0430\u043c\u0437\u0430\u0442\u043e\u0432\u0430 \u2014 \u044d\u0442\u043e \u043e\u0434\u043d\u0430 \u0438\u0437 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0443\u043b\u0438\u0446 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b, \u0433\u0434\u0435 \u043f\u0440\u043e\u0432\u043e\u0434\u044f\u0442\u0441\u044f \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u0434\u044b \u0438 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0435 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a\u0438. \u041d\u0430 \u0435\u0435 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u0430 \u043f\u0435\u0448\u0435\u0445\u043e\u0434\u043d\u0430\u044f \u0437\u043e\u043d\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0437\u0431\u0438\u0442 \u0441\u043a\u0432\u0435\u0440 \u0441 \u0448\u0438\u0440\u043e\u043a\u043e\u0439 \u043c\u043e\u0449\u0435\u043d\u043e\u0439 \u0430\u043b\u043b\u0435\u0439.\n\n\u0417\u0434\u0435\u0441\u044c \u043c\u043e\u0436\u043d\u043e \u0443\u0432\u0438\u0434\u0435\u0442\u044c \u0431\u044e\u0441\u0442\u044b \u0413. \u0426\u0430\u0434\u0430\u0441\u0430, \u041f\u0435\u0442\u0440\u0430 I, \u043c\u0435\u043c\u043e\u0440\u0438\u0430\u043b \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u043c \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u0430\u043c \u041c\u0412\u0414, \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0438 \u0410. \u0421. \u041f\u0443\u0448\u043a\u0438\u043d\u0443, \u0420. \u0413\u0430\u043c\u0437\u0430\u0442\u043e\u0432\u0443 \u0438 \u042e. \u0410\u043a\u0430\u0435\u0432\u0443.\n\u041d\u0430 \u0437\u0435\u043b\u0435\u043d\u043e\u0439 \u0437\u043e\u043d\u0435 \u043f\u0440\u043e\u0441\u043f\u0435\u043a\u0442\u0430 \u0432\u044b\u0441\u0430\u0436\u0435\u043d\u044b \u0434\u0435\u0440\u0435\u0432\u044c\u044f \u0438 \u043a\u043b\u0443\u043c\u0431\u044b. \u0412\u0434\u043e\u043b\u044c \u043f\u0435\u0448\u0435\u0445\u043e\u0434\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438 \u0440\u0430\u0441\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u0441\u043a\u0430\u043c\u0435\u0439\u043a\u0438, \u0443\u0440\u043d\u044b, \u0430 \u0437\u0430 \u0443\u043b\u0438\u0447\u043d\u043e\u0435 \u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u043e\u0442\u0432\u0435\u0447\u0430\u044e\u0442 \u0436\u0438\u0432\u043e\u043f\u0438\u0441\u043d\u044b\u0435 \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0444\u043e\u043d\u0430\u0440\u0438.",
