      description:
        "\u041c\u0443\u0437\u0435\u0439 \u043e\u0442\u043a\u0440\u044b\u0442 \u0432 2005 \u0433\u043e\u0434\u0443. \u042d\u043a\u0441\u043f\u043e\u043d\u0430\u0442\u044b \u043c\u0443\u0437\u0435\u044f \u2013 \u044d\u0442\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u044f \u043f\u043e\u0441\u043b\u0435\u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0438\u043e\u0434\u0430, \u043e\u0442\u0440\u0430\u0436\u0430\u044e\u0449\u0435\u0433\u043e \u0432\u0440\u0435\u043c\u044f \u043c\u043e\u0449\u043d\u043e\u0433\u043e \u0438\u043d\u0434\u0443\u0441\u0442\u0440\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0440\u044b\u0432\u043a\u0430 \u041a\u0438\u0437\u043b\u044f\u0440\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043b \u043e\u0431\u044b\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0433\u043e\u0440\u043e\u0434\u043e\u043a \u0432 \u0433\u043e\u0440\u043e\u0434 \u0441 \u0432\u044b\u0441\u043e\u043a\u043e\u0440\u0430\u0437\u0432\u0438\u0442\u043e\u0439 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u0438 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u0438\u043d\u0444\u0440\u0430\u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u043e\u0439.\n\n\u0412 \u043c\u0443\u0437\u0435\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u0432\u0441\u0435 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u044f, \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438, \u0437\u0430\u0441\u043b\u0443\u0436\u0435\u043d\u043d\u044b\u0435 \u043b\u044e\u0434\u0438 \u0433\u043e\u0440\u043e\u0434\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u043f\u043e\u0441\u043e\u0431\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044e \u0438 \u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044e \u041a\u0438\u0437\u043b\u044f\u0440\u0430, \u0438\u043c\u0435\u0435\u0442\u0441\u044f \u043a\u043e\u043b\u043b\u0435\u043a\u0446\u0438\u044f \u043d\u0430\u0433\u0440\u0430\u0434 \u0441\u043e \u0432\u0440\u0435\u043c\u0435\u043d \u041f\u0435\u0442\u0440\u0430 1 \u0438 \u0434\u043e \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0441\u0442\u0438.  \u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u2013 149 \u043a\u043c.",
