      description:
        "\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0438\u043c. \u041c. \u0413\u043e\u0440\u044c\u043a\u043e\u0433\u043e - \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0435\u0430\u0442\u0440 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u042d\u0442\u043e\u0442 \u0442\u0435\u0430\u0442\u0440 \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u0432 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 1925 \u0433\u043e\u0434\u0430 \u043f\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u044e \u041d\u0430\u0440\u043a\u043e\u043c\u043f\u0440\u043e\u0441\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430. \u0410\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440\u044b- \u041a. \u0412. \u0427\u0445\u0435\u0438\u0434\u0437\u0435 \u0438 \u0414. \u042f. \u041e\u0434\u0438\u0448\u0430\u0440\u0438\u044f \u0438 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440 \u041d. \u0410. \u042d\u0434\u0438\u0448\u0435\u0440\u0430\u0448\u0432\u0438\u043b\u0438 \u0441\u043f\u0440\u043e\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u0437\u0434\u0430\u043d\u0438\u0435 \u0442\u0430\u043a, \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u043e \u0441\u0442\u0430\u043b\u043e \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0439 \u0434\u043e\u043c\u0438\u043d\u0442\u043e\u0439 \u0446\u0435\u043d\u0442\u0440\u0430 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b, \u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0437\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0437\u0430\u043b\u043e\u0432 (\u043d\u0430 900 \u0438 400 \u043c\u0435\u0441\u0442) \u0434\u0430\u043b\u0430 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043b\u0443\u0447\u0448\u0435\u0433\u043e \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u0430 \u0437\u0440\u0438\u0442\u0435\u043b\u0435\u0439 \u0441 \u0430\u043a\u0442\u0451\u0440\u0430\u043c\u0438. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0441 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435\u043c \u0442\u0435\u0430\u0442\u0440\u0430 \u043f\u0440\u0438 \u043d\u0435\u043c \u0431\u044b\u043b\u0430 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0442\u0443\u0434\u0438\u044f, \u0441\u0442\u0430\u0432\u0448\u0430\u044f \u043e\u0441\u043d\u043e\u0432\u043e\u0439 \u0434\u043b\u044f \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0442\u0435\u0430\u0442\u0440\u043e\u0432. \u041d\u0430 \u0435\u0433\u043e \u0441\u0446\u0435\u043d\u0435 \u0441 \u0443\u0441\u043f\u0435\u0445\u043e\u043c \u0448\u043b\u0438 \u043b\u0443\u0447\u0448\u0438\u0435 \u043f\u044c\u0435\u0441\u044b \u0440\u0443\u0441\u0441\u043a\u043e\u0439, \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u043a\u0438. \u041f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 \u0438 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f \u0442\u0435\u0430\u0442\u0440\u0430 \u0421. \u0422\u0443\u043b\u043f\u0430\u0440\u043e\u0432\u0430 \u0432 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u0435 \u0441 2007 \u0433\u043e\u0434\u0430 \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0442\u0435\u0430\u0442\u0440\u043e\u0432, \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u041a\u0430\u0432\u043a\u0430\u0437\u0430 \u0438 \u0441\u0442\u0440\u0430\u043d \u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u043e-\u041a\u0430\u0441\u043f\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0433\u0438\u043e\u043d\u0430. \u042d\u0442\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0432\u043a\u043b\u0430\u0434 \u0432 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438, \u0432 \u0443\u043a\u0440\u0435\u043f\u043b\u0435\u043d\u0438\u0435 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u044b\u0445 \u0441\u0432\u044f\u0437\u0435\u0439.",
