        "\u0421\u0443\u043b\u0430\u043a\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u044c\u043e\u043d (\u0430\u0432\u0430\u0440. \u0421\u0443\u043b\u0430\u0445\u044a\u043aI\u043aI\u0430\u043b) \u2014 \u043a\u0430\u043d\u044c\u043e\u043d \u0432 \u0434\u043e\u043b\u0438\u043d\u0435 \u0440\u0435\u043a\u0438 \u0421\u0443\u043b\u0430\u043a (\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d), \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0433\u043b\u0443\u0431\u043e\u043a\u0438\u0445 \u0432 \u043c\u0438\u0440\u0435. \u0415\u0433\u043e \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u2014 53 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u0430, \u0433\u043b\u0443\u0431\u0438\u043d\u0430 \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u0442 1920 \u043c\u0435\u0442\u0440\u043e\u0432. \u042d\u0442\u043e \u043d\u0430 120 \u043c\u0435\u0442\u0440\u043e\u0432 \u0433\u043b\u0443\u0431\u0436\u0435 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0433\u043e \u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u043a\u0430\u043d\u044c\u043e\u043d\u0430. \u041f\u043e \u0433\u043b\u0443\u0431\u0438\u043d\u0435 \u0443\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u043b\u0438\u0448\u044c \u043a\u0430\u043d\u044c\u043e\u043d\u0443 \u041a\u043e\u0442\u0430\u0443\u0430\u0441\u0438.\n\n\u0421\u0443\u043b\u0430\u043a\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u044c\u043e\u043d \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u0440\u0435\u0432\u043e\u0441\u0445\u043e\u0434\u0438\u0442 \u043a\u0430\u043d\u044c\u043e\u043d \u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e. \u041e\u043d \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u0442\u0440\u0435\u0445 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u043a\u0430\u043d\u044c\u043e\u043d\u043e\u0432, \u043c\u0435\u0436\u0434\u0443 \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u0447\u0435\u0440\u0435\u0434\u0443\u044e\u0442\u0441\u044f \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u0435 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u044f. \u0421\u0430\u043c\u044b\u0439 \u0431\u043e\u043b\u044c\u0448\u043e\u0439, \u0434\u043b\u0438\u043d\u043e\u0439 18 \u043a\u043c, \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u0439 \u0433\u043b\u0430\u0432\u043d\u044b\u043c \u043a\u0430\u043d\u044c\u043e\u043d\u043e\u043c, \u043f\u0440\u0435\u0432\u043e\u0441\u0445\u043e\u0434\u0438\u0442 \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0443 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u0437\u0430 \u043d\u0438\u043c \u0427\u0438\u0440\u043a\u0435\u0439\u0441\u043a\u0438\u0439 \u0438 \u041c\u0438\u0430\u0442\u043b\u0438\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u044c\u043e\u043d\u044b. \u041d\u0430\u0438\u0431\u043e\u043b\u044c\u0448\u0430\u044f \u0433\u043b\u0443\u0431\u0438\u043d\u0430 \u044d\u0442\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u043a\u0430\u043d\u044c\u043e\u043d\u0430 \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u0442 \u0431\u043e\u043b\u0435\u0435 1900 \u043c \u043f\u0440\u0438 \u0448\u0438\u0440\u0438\u043d\u0435 3,5 \u043a\u043c, \u0430 \u0432\u043d\u0438\u0437\u0443, \u0443 \u0441\u0430\u043c\u043e\u0433\u043e \u0432\u043e\u0434\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0438\u0449\u0430, \u2014 \u043e\u0442 20 \u0434\u043e 45 \u043c. \u0418\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u0435\u0439\u0448\u0438\u0439 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u043f\u0440\u0438\u0440\u043e\u0434\u044b \u2014 \u0421\u0443\u043b\u0430\u043a\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u044c\u043e\u043d, \u0438 \u0432\u043e\u0437\u043d\u0438\u043a\u0448\u0435\u0435 \u0437\u0434\u0435\u0441\u044c \u043e\u0433\u0440\u043e\u043c\u043d\u043e\u0435 \u0432\u043e\u0434\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0438\u0449\u0435 \u0441\u0442\u0430\u043b\u0438 \u043c\u0435\u0441\u0442\u0430\u043c\u0438 \u043f\u0430\u043b\u043e\u043c\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0442\u0443\u0440\u0438\u0441\u0442\u043e\u0432 \u0438 \u043a\u0440\u0430\u0435\u0432\u0435\u0434\u043e\u0432. \u041a\u0430\u043d\u044c\u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0434\u043e\u0441\u0442\u043e\u043f\u0440\u0438\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0435\u0439 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430, \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e \u0435\u0433\u043e \u043f\u043e\u0441\u0435\u0449\u0430\u044e\u0442 \u0442\u044b\u0441\u044f\u0447\u0438 \u0442\u0443\u0440\u0438\u0441\u0442\u043e\u0432.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0421\u0443\u043b\u0430\u043a\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u044c\u043e\u043d\u0430 \u2014 75 \u043a\u043c.",
