      location:
        "\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d, \u0433. \u041a\u0438\u0437\u043b\u044f\u0440, \u0443\u043b. \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0413\u043e\u0440\u044c\u043a\u043e\u0433\u043e, 1, \u041c\u0443\u0437\u0435\u0439 \u0438\u043c\u0435\u043d\u0438 \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u0430",
      description:
        "\u041a\u0438\u0437\u043b\u044f\u0440\u0441\u043a\u0438\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u043e \u2014 \u043a\u0440\u0430\u0435\u0432\u0435\u0434\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439 \u0438\u043c\u0435\u043d\u0438 \u041f. \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u0430 \u2014 \u044d\u0442\u043e \u0441\u0430\u043c\u044b\u0439 \u043a\u0440\u0443\u043f\u043d\u044b\u0439 \u043c\u0443\u0437\u0435\u0439 \u0441\u0440\u0435\u0434\u0438 \u0444\u0438\u043b\u0438\u0430\u043b\u043e\u0432 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 \u0438\u043c. \u0410. \u0422\u0430\u0445\u043e \u2014 \u0413\u043e\u0434\u0438. \u041c\u0443\u0437\u0435\u0439 \u043d\u043e\u0441\u0438\u0442 \u0438\u043c\u044f \u043c\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0443\u0440\u043e\u0436\u0435\u043d\u0446\u0430, \u0433\u0435\u0440\u043e\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b 1812 \u0433. \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u041f\u0435\u0442\u0440\u0430 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u0430 \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u0430.\n\n\u0412\u044b\u0434\u0430\u044e\u0449\u0438\u0439\u0441\u044f \u043f\u043e\u043b\u043a\u043e\u0432\u043e\u0434\u0435\u0446 \u0438 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c \u0441\u0442\u0430\u0440\u0438\u043d\u043d\u043e\u0433\u043e \u043a\u043d\u044f\u0436\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u0434\u0430, \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u0438\u043b\u0441\u044f \u043a\u0430\u043a \u0432\u043e\u0435\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a, \u043d\u0435 \u0437\u043d\u0430\u044e\u0449\u0438\u0439 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0439 \u0432 \u0431\u0438\u0442\u0432\u0430\u0445 \u0438 \u043f\u0440\u043e\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u0437\u0430 \u0441\u0432\u043e\u0435 \u0431\u0435\u0441\u0441\u0442\u0440\u0430\u0448\u0438\u0435 \u00ab\u041b\u044c\u0432\u043e\u043c \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438\u00bb.\n\n\u041f\u0435\u0442\u0440 \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e \u043e\u0442\u043b\u0438\u0447\u0438\u043b\u0441\u044f \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u0432 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0445 \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u043c \u0438 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u043e\u043c \u043f\u043e\u0445\u043e\u0434\u0430\u0445 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0430, \u0430\u043d\u0442\u0438\u043d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u043e\u0439 \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438 1805-1807 \u0433\u043e\u0434\u043e\u0432, \u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u0435 (1806-1812) \u0438 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u0435 1812 \u0433\u043e\u0434\u0430, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0438 \u0431\u044b\u043b \u0441\u043c\u0435\u0440\u0442\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u043d\u0435\u043d.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u041c\u0443\u0437\u0435\u044f \u0438\u043c\u0435\u043d\u0438 \u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u0430 \u2014 149 \u043a\u043c.",
