      description:
        "\u0418\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043a \u00ab\u0420\u043e\u0441\u0441\u0438\u044f \u2014 \u043c\u043e\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f\u00bb \u2014 \u043c\u0443\u043b\u044c\u0442\u0438\u043c\u0435\u0434\u0438\u0439\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u0432\u0441\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0430 \u0441 \u0434\u0440\u0435\u0432\u043d\u0435\u0439\u0448\u0438\u0445 \u0432\u0440\u0435\u043c\u0435\u043d \u0434\u043e \u043d\u0430\u0448\u0438\u0445 \u0434\u043d\u0435\u0439, \u00ab\u0436\u0438\u0432\u043e\u0439 \u0443\u0447\u0435\u0431\u043d\u0438\u043a\u00bb \u043f\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0420\u043e\u0441\u0441\u0438\u0438. \u0412 \u043f\u0430\u0440\u043a\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u044b \u0441\u0430\u043c\u044b\u0435 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0435 \u0444\u043e\u0440\u043c\u044b \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0445 \u043d\u043e\u0441\u0438\u0442\u0435\u043b\u0435\u0439: \u0441\u0435\u043d\u0441\u043e\u0440\u043d\u044b\u0435 \u0441\u0442\u043e\u043b\u044b, \u0432\u043c\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u043d\u043e\u0442\u0435\u0430\u0442\u0440\u044b, \u043b\u0430\u0439\u0442\u0431\u043e\u043a\u0441\u044b, \u043a\u043e\u043b\u043b\u0430\u0436\u0438, \u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0440\u044b \u0438 \u043f\u043b\u0430\u043d\u0448\u0435\u0442\u044b. \u0412\u0438\u0437\u0443\u0430\u043b\u044c\u043d\u044b\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u043c\u0443\u043b\u044c\u0442\u0438\u043c\u0435\u0434\u0438\u0439\u043d\u044b\u0445 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0439 \u0441\u043e\u0437\u0434\u0430\u043d\u044b \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0432\u0438\u0434\u0435\u043e\u0438\u043d\u0444\u043e\u0433\u0440\u0430\u0444\u0438\u043a\u0438, \u0430\u043d\u0438\u043c\u0430\u0446\u0438\u0438, 3D-\u043c\u043e\u0434\u0435\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u0446\u0438\u0444\u0440\u043e\u0432\u044b\u0445 \u0440\u0435\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0439.\n\n\u0414\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0442 \u0447\u0435\u0442\u044b\u0440\u0435 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0438: \u00ab\u0420\u044e\u0440\u0438\u043a\u043e\u0432\u0438\u0447\u0438 (862\u20131598)\u00bb, \u00ab\u0420\u043e\u043c\u0430\u043d\u043e\u0432\u044b\u00bb (1613\u20131917), \u00ab\u041c\u043e\u0439 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u00bb, \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430, \u043f\u0440\u0438\u0443\u0440\u043e\u0447\u0435\u043d\u043d\u0430\u044f \u043a 800-\u043b\u0435\u0442\u0438\u044e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e. \u041f\u043e \u043d\u0438\u043c \u043f\u0440\u043e\u0432\u043e\u0434\u044f\u0442\u0441\u044f \u044d\u043a\u0441\u043a\u0443\u0440\u0441\u0438\u0438, \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043a\u0432\u0435\u0441\u0442\u044b, \u0431\u0440\u0435\u0439\u043d-\u0440\u0438\u043d\u0433\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0443\u044e\u0442\u0441\u044f \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u044f: \u043f\u043e\u044d\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0432\u0435\u0447\u0435\u0440\u0430, \u043a\u0438\u043d\u043e\u043b\u0435\u043a\u0442\u043e\u0440\u0438\u0438, \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u044b, \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0435 \u043b\u0435\u043a\u0446\u0438\u0438, \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438, \u0434\u0435\u0442\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a\u0438, \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u043a\u0438\u0435 \u0432\u0441\u0442\u0440\u0435\u0447\u0438 \u0441 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u043c\u0438 \u043b\u044e\u0434\u044c\u043c\u0438 (\u0443\u0447\u0435\u043d\u044b\u043c\u0438, \u0434\u0435\u044f\u0442\u0435\u043b\u044f\u043c\u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0438 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430, \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u0430\u043c\u0438).",
