      name: "\u0414\u043e\u043c-\u043c\u0443\u0437\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043f\u043e\u044d\u0442\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d\u0430 \u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e",
      location:
        "\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d, \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d-\u0421\u0442\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d, \u0441. \u0410\u0448\u0430\u0433\u0430-\u0421\u0442\u0430\u043b, \u0414\u043e\u043c-\u043c\u0443\u0437\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043f\u043e\u044d\u0442\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d\u0430 \u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e",
      description:
        "\u0414\u043e\u043c-\u043c\u0443\u0437\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043f\u043e\u044d\u0442\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430 \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d\u0430 \u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0441. \u0410\u0448\u0430\u0433\u0430-\u0421\u0442\u0430\u043b \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d-\u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d.\n\n\u0414\u043e\u043c-\u043c\u0443\u0437\u0435\u0439 \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d\u0430 \u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u043c \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f. \u041f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420 \u043d\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0443\u044e \u043e\u0445\u0440\u0430\u043d\u0443 \u0431\u044b\u043b \u043f\u0440\u0438\u043d\u044f\u0442 \u0441\u0442\u0430\u0440\u044b\u0439 \u0433\u043b\u0438\u043d\u044f\u043d\u044b\u0439 \u0434\u043e\u043c \u0441\u0435\u043c\u044c\u0438 \u043f\u043e\u044d\u0442\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043d \u0440\u043e\u0434\u0438\u043b\u0441\u044f (\u043c\u0430\u043a\u0435\u0442 \u0438\u043c\u0435\u0435\u0442\u0441\u044f \u0432 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u043c \u043f\u043e\u043a\u0430\u0437\u0435). \u0412 1977 \u0433\u043e\u0434\u0443 \u044d\u0442\u043e\u0442 \u0434\u043e\u043c \u0431\u044b\u043b \u0443\u0442\u0440\u0430\u0447\u0435\u043d \u0438\u0437-\u0437\u0430 \u0432\u043e\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u044b\u0445 \u0444\u0430\u043a\u0442\u043e\u0440\u043e\u0432. \u0420\u044f\u0434\u043e\u043c \u0441 \u0435\u0449\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u043c \u0441\u0442\u0430\u0440\u044b\u043c \u0434\u043e\u043c\u043e\u043c \u043f\u043e\u044d\u0442\u0430 \u0432 1934 \u0433\u043e\u0434\u0443 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u043d\u043e\u0432\u044b\u0439 \u0434\u043e\u043c \u0438\u0437 \u0441\u0430\u043c\u0430\u043d\u0430. \u0412 1985 \u0433\u043e\u0434\u0443, \u0432 \u0432\u0438\u0434\u0443 \u0432\u0435\u0442\u0445\u043e\u0441\u0442\u0438 \u0438 \u0430\u0432\u0430\u0440\u0438\u0439\u043d\u043e\u0441\u0442\u0438 \u0441\u0442\u0440\u043e\u0435\u043d\u0438\u044f, \u044f\u0432\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f, \u0441\u0430\u043c\u0430\u043d\u043d\u043e\u0435 \u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0441\u043d\u0435\u0441\u0435\u043d\u043e \u0438 \u043d\u0430 \u0435\u0433\u043e \u043c\u0435\u0441\u0442\u0435 \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043e \u043d\u043e\u0432\u043e\u0435, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u043b\u043e\u0441\u044c \u0443\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043e\u0434\u0436\u043e\u0433\u0443.\n\n\u041f\u043e\u0441\u043b\u0435 \u043f\u043e\u0436\u0430\u0440\u0430 (\u0432 \u043d\u043e\u0447\u044c \u0441 21 \u043d\u0430 22 \u043c\u0430\u0440\u0442\u0430 2016 \u0433\u043e\u0434\u0430) \u0414\u043e\u043c-\u043c\u0443\u0437\u0435\u0439 \u0421\u0443\u043b\u0435\u0439\u043c\u0430\u043d \u0421\u0442\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0431\u044b\u043b \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d \u0437\u0430 \u0441\u0440\u0430\u0432\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043a\u043e\u0440\u043e\u0442\u043a\u0438\u0439 \u043f\u0435\u0440\u0438\u043e\u0434.\n\n\u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u0414\u043e\u043c\u0430-\u043c\u0443\u0437\u0435\u044f \u043f\u043e\u044d\u0442\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u0432 \u0414\u0435\u043d\u044c \u0434\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u043e\u044d\u0437\u0438\u0438, 18 \u043c\u0430\u044f 2017 \u0433\u043e\u0434\u0430, \u0432 \u0441\u0435\u043b\u0435 \u0410\u0448\u0430\u0433\u0430-\u0421\u0442\u0430\u043b.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0441. \u0410\u0448\u0430\u0433\u0430-\u0421\u0442\u0430\u043b \u2014 188 \u043a\u043c.",
