      description:
        "\u0414\u0436\u0443\u043c\u0430-\u043c\u0435\u0447\u0435\u0442\u044c \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0441\u0442\u043e\u0438\u0442 \u0432 \u0441\u0430\u043c\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 \u0441\u0442\u043e\u043b\u0438\u0446\u044b \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430. \u042d\u0442\u043e \u043e\u0434\u043d\u043e \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0431\u043e\u043b\u044c\u0448\u0438\u0445 \u0438 \u043a\u0440\u0430\u0441\u0438\u0432\u044b\u0445 \u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u044b\u0445 \u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0439 \u0432 \u0415\u0432\u0440\u043e\u043f\u0435. \u041c\u0435\u0447\u0435\u0442\u044c \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e \u0440\u0430\u0441\u0448\u0438\u0440\u044f\u044e\u0442, \u043d\u043e \u043e\u043d\u0430 \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u0435\u0442 \u044d\u0441\u0442\u0435\u0442\u0438\u0447\u043d\u044b\u0439 \u0432\u043d\u0435\u0448\u043d\u0438\u0439 \u0432\u0438\u0434 \u0438 \u0433\u0435\u043e\u043c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043f\u0440\u043e\u043f\u043e\u0440\u0446\u0438\u0438. \u0414\u0436\u0443\u043c\u0430-\u043c\u0435\u0447\u0435\u0442\u044c \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0432\u0435\u043b\u0438\u043a\u043e\u043b\u0435\u043f\u043d\u043e\u0439 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b, \u0443\u043a\u0440\u0430\u0448\u0430\u044e\u0449\u0438\u0439 \u0433\u043e\u0440\u043e\u0434, \u043d\u043e \u0438 \u043c\u0435\u0441\u0442\u043e, \u043a\u0443\u0434\u0430 \u043b\u044e\u0434\u0438 \u043f\u0440\u0438\u0445\u043e\u0434\u044f\u0442 \u043f\u043e\u0431\u044b\u0442\u044c \u043d\u0430\u0435\u0434\u0438\u043d\u0435 \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u0411\u043e\u0433\u043e\u043c, \u0437\u0430\u0431\u044b\u0442\u044c \u043e \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0440\u0430\u0441\u043f\u0440\u044f\u0445.\n\n\u0421\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043c\u0435\u0447\u0435\u0442\u0438 \u0431\u044b\u043b\u043e \u043d\u0430\u0447\u0430\u0442\u043e \u0432 1991 \u0433\u043e\u0434\u0443. \u0417\u0430 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u043d\u044f\u0442\u0430 \u0413\u043e\u043b\u0443\u0431\u0430\u044f \u043c\u0435\u0447\u0435\u0442\u044c \u0432 \u0421\u0442\u0430\u043c\u0431\u0443\u043b\u0435. \u0422\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u0432 1997 \u0433\u043e\u0434\u0443.",
