      description:
        "\u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e (\u0430\u0437\u0435\u0440\u0431. Bazard\u00fcz\u00fc) \u2014 \u0432\u0435\u0440\u0448\u0438\u043d\u0430 \u0412\u043e\u0434\u043e\u0440\u0430\u0437\u0434\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0445\u0440\u0435\u0431\u0442\u0430 \u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u041a\u0430\u0432\u043a\u0430\u0437\u0430 \u043d\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0435 \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0430 \u0438 \u0420\u043e\u0441\u0441\u0438\u0438 (\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d). \u0412\u044b\u0441\u043e\u0442\u0430 \u0432\u0435\u0440\u0448\u0438\u043d\u044b \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 4466 \u043c\u0435\u0442\u0440\u043e\u0432.\n\n\u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e \u0448\u0438\u0440\u043e\u043a\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430 \u043a\u0430\u043a \u0441\u0430\u043c\u0430\u044f \u044e\u0436\u043d\u0430\u044f \u0442\u043e\u0447\u043a\u0430 \u0420\u043e\u0441\u0441\u0438\u0438, \u043d\u043e \u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u043e\u043d\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043f\u043e\u0447\u0442\u0438 \u043d\u0430 4 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u0430 \u0441\u0435\u0432\u0435\u0440\u043d\u0435\u0435 \u044d\u0442\u043e\u0439 \u0442\u043e\u0447\u043a\u0438, \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0438 7,3 \u043a\u043c. \u0412 \u0441\u0432\u043e\u044e \u043e\u0447\u0435\u0440\u0435\u0434\u044c, \u0433\u043e\u0440\u044b \u0420\u0430\u0433\u0434\u0430\u043d \u0438 \u041d\u0435\u0441\u0435\u043d \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u044e\u0436\u043d\u0435\u0435 \u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e \u0438 \u0431\u043b\u0438\u0436\u0435 \u043a \u0441\u0430\u043c\u043e\u0439 \u044e\u0436\u043d\u043e\u0439 \u0442\u043e\u0447\u043a\u0435 \u0433\u0440\u0430\u043d\u0438\u0446\u044b \u0420\u043e\u0441\u0441\u0438\u0438, \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u044f\u0445 2,2 \u0438 3,7 \u043a\u043c \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e. \u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432\u044b\u0441\u043e\u0447\u0430\u0439\u0448\u0435\u0439 \u0432\u0435\u0440\u0448\u0438\u043d\u043e\u0439 \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0430 \u0438 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430. \u0421\u043b\u043e\u0436\u0435\u043d\u0430 \u0433\u043b\u0438\u043d\u0438\u0441\u0442\u044b\u043c\u0438 \u0441\u043b\u0430\u043d\u0446\u0430\u043c\u0438 \u0438 \u043f\u043e\u0440\u0444\u0438\u0440\u0438\u0442\u0430\u043c\u0438.\n\n\u0412 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0435 \u0441 \u0430\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e \u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442 \u00ab\u0440\u044b\u043d\u043e\u0447\u043d\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c\u00bb, \u0442\u043e\u0447\u043d\u0435\u0435, \u043a\u0430\u043a \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u044b\u0439 \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440 \u2014 \u00ab\u043f\u043e\u0432\u043e\u0440\u043e\u0442 \u043a \u0440\u044b\u043d\u043a\u0443, \u0431\u0430\u0437\u0430\u0440\u0443\u00bb.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0433\u043e\u0440\u044b \u0411\u0430\u0437\u0430\u0440\u0434\u044e\u0437\u044e \u2013 265 \u043a\u043c.",
