        "\u0411\u0430\u0440\u0445\u0430\u043d \u0421\u0430\u0440\u044b\u043a\u0443\u043c \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\u0430 \u0432 20 \u043a\u043c \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b. \u0421\u0430\u0440\u044b\u043a\u0443\u043c \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043a\u0430\u043a \u00ab\u0436\u0435\u043b\u0442\u044b\u0439 \u043f\u0435\u0441\u043e\u043a\u00bb \u0438 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u043c \u0431\u0430\u0440\u0445\u0430\u043d\u043e\u043c \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0420\u043e\u0441\u0441\u0438\u0438, \u043d\u043e \u0438 \u043d\u0430 \u0432\u0441\u0435\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u043a\u0435 \u0415\u0432\u0440\u0430\u0437\u0438\u044f. \u0412\u044b\u0441\u043e\u0442\u0430 \u0431\u0430\u0440\u0445\u0430\u043d\u0430 \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u0442 262 \u043c, \u043f\u043b\u043e\u0449\u0430\u0434\u044c \u2014 600 \u0433\u0435\u043a\u0442\u0430\u0440\u043e\u0432. \u0421\u0430\u0440\u044b\u043a\u0443\u043c \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u043c\u0435\u0441\u0442\u043e\u043c \u0432 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0435, \u0433\u0434\u0435 \u043d\u0430 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u0438\u0438 5 \u043c\u0435\u0441\u044f\u0446\u0435\u0432, \u0441 \u043c\u0430\u044f \u043f\u043e \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044c, \u0441\u0440\u0435\u0434\u043d\u0435\u043c\u0435\u0441\u044f\u0447\u043d\u044b\u0435 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u043f\u0440\u0435\u0432\u044b\u0448\u0430\u044e\u0442 20\u00b0. \u041b\u0435\u0442\u043e\u043c \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0430 \u043d\u0430 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0438 \u0431\u0430\u0440\u0445\u0430\u043d\u0430 \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u0442 60 \u0433\u0440\u0430\u0434\u0443\u0441\u043e\u0432.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0431\u0430\u0440\u0445\u0430\u043d\u0430 \u0421\u0430\u0440\u044b\u043a\u0443\u043c \u2014 32 \u043a\u043c.",
