      name: "\u0426\u0435\u0440\u043a\u043e\u0432\u044c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0412\u0441\u0435\u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f",
      location:
        "\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d, \u0433. \u0414\u0435\u0440\u0431\u0435\u043d\u0442, \u0443\u043b. \u0420\u0437\u0430\u0435\u0432\u0430, 7, \u0426\u0435\u0440\u043a\u043e\u0432\u044c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0412\u0441\u0435\u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f",
      description:
        "\u0426\u0435\u0440\u043a\u043e\u0432\u044c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0412\u0441\u0435\u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f (\u0421\u0443\u0440\u0431 \u0410\u043c\u0435\u043d\u0430\u043f\u0440\u043a\u0438\u0447) \u2014 \u0430\u0440\u043c\u044f\u043d\u0441\u043a\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0430. \u0410\u0432\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u043e\u0435\u043a\u0442\u0430 \u0446\u0435\u0440\u043a\u0432\u0438 \u0431\u044b\u043b \u0430\u0440\u043c\u044f\u043d\u0441\u043a\u0438\u0439 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c \u0413. \u041c. \u0421\u0443\u043d\u0434\u0443\u043a\u044f\u043d, \u043e\u0442\u0431\u044b\u0432\u0430\u0432\u0448\u0438\u0439 \u0432 1850-\u0435 \u0433\u043e\u0434\u044b \u0432 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0435 \u0441\u0441\u044b\u043b\u043a\u0443. \u0426\u0435\u0440\u043a\u043e\u0432\u044c \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0430 1870 \u0433\u043e\u0434\u0443 \u0432 \u0430\u0440\u043c\u044f\u043d\u0441\u043a\u043e\u043c \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430, \u043d\u0430 \u043c\u0435\u0441\u0442\u0435 \u0447\u0430\u0441\u043e\u0432\u043d\u0438. \u0412 1888 \u0433\u043e\u0434\u0443 \u043a \u0446\u0435\u0440\u043a\u0432\u0438 \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0435\u043d\u0430 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u044f. \u0421\u0438\u043b\u044c\u043d\u043e \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043b\u0430 \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b, \u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438 \u0431\u044b\u043b\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u044b \u0434\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u044b\u0439 \u0448\u0430\u0442\u0440\u043e\u0432\u044b\u0439 \u0431\u0430\u0440\u0430\u0431\u0430\u043d, \u0432\u0435\u0440\u0445\u043d\u0438\u0439 \u0448\u0430\u0442\u0440\u043e\u0432\u044b\u0439 \u044f\u0440\u0443\u0441 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u0438 \u0438 \u043a\u0440\u043e\u0432\u043b\u044f.\n\n\u0412 1975 \u0433\u043e\u0434\u0430 \u0437\u0434\u0430\u043d\u0438\u0435 \u0446\u0435\u0440\u043a\u0432\u0438 \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043e \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u043e\u043c \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b \u0438 \u0432\u0437\u044f\u0442\u043e \u043f\u043e\u0434 \u043e\u0445\u0440\u0430\u043d\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430. \u0421 1976 \u043f\u043e 1982 \u0433\u043e\u0434 \u0445\u0440\u0430\u043c \u0431\u044b\u043b \u043e\u0442\u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0438\u0440\u043e\u0432\u0430\u043d, \u0437\u0430\u043d\u043e\u0432\u043e \u043e\u0442\u0441\u0442\u0440\u043e\u0435\u043d\u044b \u0443\u0442\u0440\u0430\u0447\u0435\u043d\u043d\u044b\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b. \u041f\u043e\u0441\u043b\u0435 \u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0438\u0438 \u0437\u0434\u0430\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u0414\u0435\u0440\u0431\u0435\u043d\u0442\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u043e-\u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u0438 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f-\u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\u0430: \u0432 \u043d\u0435\u043c \u0440\u0430\u0437\u043c\u0435\u0449\u0435\u043d \u043e\u0442\u0434\u0435\u043b \u00ab\u041a\u043e\u0432\u0440\u0430 \u0438 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u043e-\u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u0433\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430\u00bb.\n\n\u0417\u0434\u0430\u043d\u0438\u0435 \u0446\u0435\u0440\u043a\u0432\u0438 \u043a\u0440\u0435\u0441\u0442\u043e\u0432\u043e-\u043a\u0443\u043f\u043e\u043b\u044c\u043d\u043e\u0435. \u0412\u044b\u0441\u0442\u0440\u043e\u0435\u043d\u043e \u0438\u0437 \u043e\u0431\u0442\u0435\u0441\u0430\u043d\u043d\u044b\u0445 \u043a\u0430\u043c\u043d\u0435\u0439 \u0440\u0430\u043a\u0443\u0448\u0435\u0447\u043d\u0438\u043a\u0430, \u0441\u0442\u0435\u043d\u044b \u043d\u0435 \u043e\u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u0435\u043d\u044b. \u0412 \u0446\u0435\u043d\u0442\u0440\u0435 \u0437\u0430\u043b\u0430 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u044b \u0447\u0435\u0442\u044b\u0440\u0435 \u0441\u0442\u043e\u043b\u0431\u0430 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044e\u0449\u0438\u0445 \u0434\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u044b\u0439 \u0431\u0430\u0440\u0430\u0431\u0430\u043d. \u0412\u0445\u043e\u0434\u044b \u0432 \u0432\u0438\u0434\u0435 \u043f\u043e\u0440\u0442\u0430\u043b\u043e\u0432 \u043d\u0430 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u043c, \u044e\u0436\u043d\u043e\u043c \u0438 \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u043c \u0444\u0430\u0441\u0430\u0434\u0430\u0445. \u041f\u043e \u0447\u0435\u0442\u044b\u0440\u0435 \u043e\u043a\u043d\u0430 \u043d\u0430 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u0438 \u044e\u0436\u043d\u043e\u043c \u0444\u0430\u0441\u0430\u0434\u0430\u0445 (\u043f\u043e 2 \u043b\u043e\u0436\u043d\u044b\u0445) \u0438 \u0434\u0432\u0430 \u043d\u0430 \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u043c. \u0410\u043f\u0441\u0438\u0434\u0430 \u0432 \u0432\u0438\u0434\u0435 \u0432\u044b\u0441\u0442\u0443\u043f\u0430 \u0441 \u043b\u043e\u0436\u043d\u044b\u043c \u043e\u043a\u043d\u043e\u043c. \u041d\u0430\u0434 \u0441\u0435\u0432\u0435\u0440\u043d\u044b\u043c\u0438 \u0438 \u044e\u0436\u043d\u044b\u043c\u0438 \u0432\u0440\u0430\u0442\u0430\u043c\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043d\u0430 \u0430\u043f\u0441\u0438\u0434\u0435 \u0438\u043c\u0435\u044e\u0442\u0441\u044f \u043a\u0440\u0435\u0441\u0442\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u0435 \u043e\u043a\u043d\u0430.\n\n\u0421 \u043c\u0430\u044f 2009 \u0433\u043e\u0434\u0430 \u0432 \u0446\u0435\u0440\u043a\u0432\u0438 \u043f\u0435\u0440\u0438\u043e\u0434\u0438\u0447\u0435\u0441\u043a\u0438 \u043f\u0440\u043e\u0432\u043e\u0434\u044f\u0442\u0441\u044f \u043e\u0431\u0440\u044f\u0434\u044b \u043f\u043e \u043a\u0440\u0435\u0449\u0435\u043d\u0438\u044e \u0438 \u0432\u0435\u043d\u0447\u0430\u043d\u0438\u044e \u043f\u0440\u0438\u0445\u043e\u0436\u0430\u043d.\n\n\u0420\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043e\u0442 \u041c\u0430\u0445\u0430\u0447\u043a\u0430\u043b\u044b \u0434\u043e \u0426\u0435\u0440\u043a\u0432\u0438 \u2014 136 \u043a\u043c.",
